import { Box, Flex, Image, Text } from "@chakra-ui/react";
import logo from "../../assets/images/rickyandmorty.png";
export const Header = () => {
  return (
    <>
      <Flex h="500px">
        <Box w="50%">
          <Image src={logo} w="600px" />
        </Box>
        <Box clipPath="polygon(99% 0, 0% 100%, 100% 100%)" bg="red" w="70%">
          <Text>Lista todos personagens de Ricky and Morty!</Text>
        </Box>
      </Flex>
    </>
  );
};
